import {BrowseRouter as R,Routes,Route} from "react-router-dom"
import './App.css';
import Signup from './pages/Signup';
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/Signup" element="{<Signup/>}"/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
